private void printProps() {
  System.out.println("------------> config properties:");
  for (Iterator it = props.keySet().iterator(); it.hasNext();) {
    String propName = (String) it.next();
    System.out.println(propName + " = " + props.getProperty(propName));
  }
  System.out.println("-------------------------------");
}

